import React from "react";
import "./styles.css";
import SkillsCard from "./SkillsCard";
import "../../node_modules/font-awesome/css/font-awesome.min.css";

function Skills() {
  return (
    <div
      id="skills"
      style={MainDiv}
      data-aos="fade-down"
      data-aos-duration="9000"
    >
      <div style={Heading}>
        <div>Skills</div>
      </div>
      <div
        style={{
          backgroundColor: "#F1F2F2",
          padding: "1%",
        }}
      >
        <div style={Content}>
          <div className="container">
            <div
              className="row d-flex"
              style={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <SkillsCard
                icon={require("../Icons/Icons-01.png")}
                cardName={"Front End"}
                skills={[{ name: "React" }, { name: "Angular" }]}
              />
              <SkillsCard
                icon={require("../Icons/Icons-02.png")}
                cardName={"Back End"}
                skills={[{ name: "React" }, { name: "Angular" }]}
              />
              <SkillsCard
                icon={require("../Icons/Icons-03.png")}
                cardName={"Database"}
                skills={[{ name: "React" }, { name: "Angular" }]}
              />
                            <SkillsCard
                icon={require("../Icons/Icons-04.png")}
                cardName={"Cloud"}
                skills={[{ name: "Heroku" }, { name: "Travis CI" }]}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

const MainDiv = {
  marginTop: "70px",
  // height: window.innerHeight,
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontWeight: "bold",
  fontSize: "22px",
  // fontFamily: "playfair display",
  color: "white",
  margin: "1%",
  padding: "5%",
  // textAlign: "left",
  // display: "inline-block",
};

export default Skills;
